Betul, Direct Message sebenarnya sama dengan room biasa - perbedaannya hanya pada jumlah participant yang dlm hal ini hanya 2 orang.

Step :

1. Klik tombol tambah room
{F4974}

2. Buat nama room dan orang yang hendak di DM.
{F4975}

3. Selesai. DM akan muncul di bagian "Direct Messages"
{F4976}

